import React from 'react';
import { StyleSheet, Text, View, TouchableOpacity, TextInput, Button, ScrollView  } from 'react-native';

export default function RegistrationForm({navigation}) {
return (
    <View style={styles.container}>
    <Text style = {styles.heading}>SIGNUP</Text>
    <ScrollView style = {styles.innercontainer}>
    <TextInput style = {styles.txtBox}  value = "Email"/>
    <TextInput style = {styles.txtBox}  value = "Password" />
    <TextInput style = {styles.txtBox}  value = "Repeat Password" />
    <TextInput style = {styles.txtBox}  value = "Email"/>
    <TextInput style = {styles.txtBox}  value = "Password" />
    <TextInput style = {styles.txtBox}  value = "Repeat Password" />
    <TouchableOpacity style={styles.appButtonContainer}>
        <Text style={styles.appButtonText}>SignUp</Text>
    </TouchableOpacity>
    </ScrollView>
    <Text style = {styles.signupDire} >Already a member ?
        <TouchableOpacity  onPress = {() => navigation.navigate('Login')}>
        <Text style = {styles.tot}> Login Here</Text>
        </TouchableOpacity>
    </Text>
    </View>
);
}

const styles = StyleSheet.create({
container: {
    flex: 1,
    backgroundColor: '#242945',
    alignItems: 'center',
    justifyContent: 'center',
},
heading: {
    color:'white',
    // fontWeight: 'bold',
    fontSize: 40,
    fontFamily:'Roboto',
    marginBottom: 100
},
innercontainer: {
width:'80%',
height:'50%',
backgroundColor: 'white',
borderWidth: 5,
borderColor: 'lightgrey',
borderRadius: 10,
borderBottomWidth:15,

},
signupDire:{
    color: 'white',
    marginTop: 10
},
tot:{
    color: 'orange'
},
txtBox:{
    height: 40,
    borderColor: '#242945',
    borderWidth: 2 ,
    borderRadius: 3,
    margin: '5%',
    backgroundColor: '#242945',
    color: 'white',
    textAlign: 'center'
},
appButtonText: {
    fontSize: 14,
    color: "white",
    fontWeight: "bold",
    alignSelf: "center",
    textTransform: "uppercase"
},
appButtonContainer: {
    margin: '5%',
    width:'90%',
    elevation: 8,
    backgroundColor: "#009688",
    borderRadius: 5,
    paddingVertical: 8,
    paddingHorizontal: 10
},

});
